public class BruteForceUtil {
public static int getBruteForceCardinality(final char character) {
    boolean lower = false, upper = false, digits = false, symbols = false, unicode = false;
    if (0x30 <= character && character <= 0x39) {
        digits = true;
    } else if (0x41 <= character && character <= 0x5a) {
        upper = true;
    } else if (0x61 <= character && character <= 0x7a) {
        lower = true;
    } else if (character <= 0x7f) {
        symbols = true;
    } else {
        unicode = true;
    }
    int cardinality = 0;
    if (digits) {
        cardinality += 10;
    }
    if (upper) {
        cardinality += 26;
    }
    if (lower) {
        cardinality += 26;
    }
    if (symbols) {
        cardinality += 33;
    }
    if (unicode) {
        cardinality += 100;
    }
    return cardinality;
}public static int getBruteForceCardinality(final String password);
public static int getBruteForceCardinality(final char character);

